export default function Navbar() {
    return (
        <nav className="w-20 h-screen flex flex-col justify-evenly items-center bg-indigo-950 text-white text-4xl">
            <div id='functions' className='flex flex-col'>
                <FiFeather className=''/>
                <hr className='my-24' />
                <BiHomeAlt2 />
                <BiUser />
                <BiLogOut />
            </div>
            <div>
                <hr className='my-24' />
                <BiInfoCircle />
            </div>
        </nav>
    );
};
